{
  "name": "UBX-RXM-PMP",
  "class_id": "0x02",
  "message_id": "0x72",
  "description": "PMP (LBAND) message",
  "message_type": "input",
  "payload": {
    "length": {
      "variable": {
        "base": 24,
        "formula": "24 + numSV * 24",
        "min": 24
      }
    },
    "fields": [
      {
        "name": "version",
        "byte_offset": 0,
        "data_type": "U1",
        "description": "Message version (0x01 for this version)"
      },
      {
        "name": "reserved0",
        "byte_offset": 1,
        "data_type": {
          "array_of": "U1",
          "count": 22
        },
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "numSV",
        "byte_offset": 23,
        "data_type": "U1",
        "description": "Number of satellites in repeated block"
      }
    ],
    "repeated_groups": [
      {
        "name": "satelliteData",
        "repetition_type": "count_field",
        "count_field": "numSV",
        "group_size_bytes": 24,
        "base_offset": 24,
        "fields": [
          {
            "name": "gnssId",
            "byte_offset": 0,
            "data_type": "U1",
            "description": "GNSS ID (see Satellite Numbering)"
          },
          {
            "name": "svId",
            "byte_offset": 1,
            "data_type": "U1",
            "description": "Satellite ID (see Satellite Numbering)"
          },
          {
            "name": "CNo",
            "byte_offset": 2,
            "data_type": "U1",
            "description": "carrier noise ratio (0..63)"
          },
          {
            "name": "mpathIndic",
            "byte_offset": 3,
            "data_type": "U1",
            "description": "multipath index (according to [1]) (0 = not measured, 1 = low, 2 = medium, 3 = high)"
          },
          {
            "name": "dopplerMS",
            "byte_offset": 4,
            "data_type": "I4",
            "description": "Doppler measurement",
            "unit": "m/s",
            "scale": {
              "raw": "0.04",
              "multiplier": 0.04
            }
          },
          {
            "name": "dopplerHz",
            "byte_offset": 8,
            "data_type": "I4",
            "description": "Doppler measurement",
            "unit": "Hz",
            "scale": {
              "raw": "0.2",
              "multiplier": 0.2
            }
          },
          {
            "name": "wholeChips",
            "byte_offset": 12,
            "data_type": "U2",
            "description": "whole value of the code phase measurement (0..1022 for GPS)"
          },
          {
            "name": "fracChips",
            "byte_offset": 14,
            "data_type": "U2",
            "description": "fractional value of the code phase measurement (0..1023)"
          },
          {
            "name": "codePhase",
            "byte_offset": 16,
            "data_type": "U4",
            "description": "Code phase",
            "unit": "ms",
            "scale": {
              "raw": "2^-21",
              "multiplier": 4.76837158203125e-7
            }
          },
          {
            "name": "intCodePhase",
            "byte_offset": 20,
            "data_type": "U1",
            "description": "Integer (part of the) code phase",
            "unit": "ms"
          },
          {
            "name": "pseuRangeRMS",
            "byte_offset": 21,
            "data_type": "U1",
            "description": "pseudorange RMS error index (according to [1]) (0..63) Err"
          },
          {
            "name": "reserved4",
            "byte_offset": 22,
            "data_type": {
              "array_of": "U1",
              "count": 2
            },
            "description": "Reserved",
            "reserved": true
          }
        ]
      }
    ]
  }
}

